import React from "react";
// javascript library that creates a parrallax effect
// reactstrap components
import { Container, Button, Link } from 'react-floating-action-button'
// core components
import WhiteNavbar from "components/Navbars/WhiteNavbar.js";
import ContactUsHeader from "components/Headers/ContactUsHeader.js";
import ProductPageHeader from "components/Headers/ProductPageHeader.js";

import FooterBlack from "components/Footers/FooterBlack.js";
import ContactUsHeader2 from "components/Headers/ContactUsHeader2.js";

// sections for this page

import Testimonials from "./presentation-sections/Testimonials.js";


function Testimonials2() {
  const [activeIndex, setActiveIndex] = React.useState(0);
  const [animating, setAnimating] = React.useState(false);

  return (
    <>

    <WhiteNavbar />


      <div className="wrapper">
<ProductPageHeader/>
<ContactUsHeader2/>

<Testimonials />

<Container>
            <Link href="/contact-us"
                tooltip="E-Mail"
                icon="far fa-sticky-note" />
            <Link href="/contact-us"
                tooltip="Call Us"
                icon="fas fa-user-plus" />
            <Button
                tooltip="Get a quote!"
                icon="fas fa-plus"
                rotate={true}
                onClick={() => alert('Contact us here!')} />
        </Container>
            <FooterBlack />

      </div>
    </>
  );
}

export default Testimonials2;
